music.controls = true;

let count=0
const MUSIC=(data)=>{

    document.getElementById("music").innerHTML=""

    let img = document.createElement("img");
    img.src = arr[data].img;

    let name = document.createElement("marquee");
    name.style.fontSize = "20px";
    name.style.color = "red";
    name.textContent = arr[data].name;


    let music = document.createElement("audio");
    music.src = arr[data].music;
    let div = document.createElement("div");



    let next=document.createElement("button")
next.textContent = "next"
next.addEventListener("click",()=>{
    if(data<arr.length-1){
    MUSIC(data+1)
    }
    else{
        alert("no music found")
    }
})

let prev=document.createElement("button")

prev.textContent = "prev"

prev.addEventListener("click",()=>{
    if(data>0)
        {
    MUSIC(data-1)
    }
   
   
})

    div.append(music)
    music.controls = true;

    img.addEventListener("click", () => {
        music.play();
        
    });

    name.addEventListener("click", () => {
        music.play();
    });

    let musicContainer = document.getElementById("music");
    musicContainer.append(img, name, div,next,prev);

}



